def comb_sort(nums):
    """Sorts a list of elements using the comb sort algorithm."""
    n = len(nums)
    gap = n // 2
    for i in range(n):
        for j in range(0, gap):
            if nums[i] > nums[j]:
                nums[i], nums[j] = nums[j], nums[i]
                gap = j
    for i in range(gap, n):
        for j in range(0, n - gap - 1):
            if nums[j] > nums[j + 1]:
                nums[j], nums[j + 1] = nums[j + 1], nums[j]
