def snake_to_camel(word):
    """Converts a snake case string to camel case string."""
    words = word.split()
    result = []
    for i, word in enumerate(words):
        if i < len(words) - 1:
            result.append(words[i].lower())
        else:
            result.append(words[i].capitalize())
    return "".join(result)
```

