def common_in_nested_lists(nestedlist) -> list:
    """
    Finds common elements in given nested lists.

    Args:
        nestedlist (list): A list of lists.

    Returns:
        list: A list of common elements.
    """
    if not nestedlist:
        return []

    common = []
    for sublist in nestedlist:
        if not sublist:
            continue

        current_common = []
        for item in sublist:
            if item in common:
                current_common.append(item)

        if current_common:
            common = current_common

    return common
```

