def check_triplet(A, n, sum, count) -> bool:
    """
    Given an array A of size n, find the triplet with sum of the given array.
    For example:
    check_triplet([1, 2, 3, 4, 5], 5, 6, 3) == True
    check_triplet([1, 2, 3, 4, 5], 5, 10, 3) == False
    """
    for i in range(n - 2):
        for j in range(i + 1, n - 1):
            for k in range(j + 1, n):
                if A[i] + A[j] + A[k] == sum:
                    return True
    return False
```

