def reverse_vowels(str1):
    vowels = "aeiouAEIOU"
    vowel_list = []
    for char in str1:
        if char in vowels:
            vowel_list.append(char)
    vowel_list.reverse()
    result = ""
    vowel_index = 0
    for char in str1:
        if char in vowels:
            result += vowel_list[vowel_index]
            vowel_index += 1
        else:
            result += char
    return result
```

