        if index == n:
            return []

        key = (index, prev)
        if key in dp:
            return dp[key]

        ans = []
        for i in range(n):
            if abs(arr[i] - prev) == 1:
                if prev == -1 or abs(arr[i] - prev) > 1:
                    subsequence = [arr[i]] + solve(i + 1, arr[i])
                    if len(subsequence) > len(ans):
                        ans = subsequence

        dp[key] = ans
        return ans

    return solve(0, -1)
