def find_x_and_y(a, b, n):
  """
  Finds the values of x and y that satisfy the equation ax + by = n.

  Args:
    a: The coefficient of x.
    b: The coefficient of y.
    n: The constant term.

  Returns:
    A tuple containing the values of x and y that satisfy the equation.
    Returns None if no solution exists.
  """
  if a == 0:
    if b == 0:
      return None  # No solution if both a and b are zero
    else:
      return None  # No solution if a is zero but b is not

  res = True
  for x in range(int(n / b)):
    y = n / b - a * x
    if y >= 0:
      res = True
    else:
      res = False

  if res:
    return (int(n / b), int(n / b))
  else:
    return None
```

