def find_x_y(a, b, n):
    """
    Finds the values of x and y that satisfy the equation ax + by = n.

    Args:
        a: The coefficient of x.
        b: The coefficient of y.
        n: The constant term.

    Returns:
        A tuple (x, y) if a solution exists, otherwise None.
    """
    if a == 0 and b == 0:
        if n == 0:
            return (0, 0)
        else:
            return None  # No solution

    if a == 0:
        if n != 0:
            return None
        else:
            return (1, 0)

    if b == 0:
        if n != 0:
            return None
        else:
            return (0, 1)

    # Cramer's rule
    determinant = a * b - n
    if determinant == 0:
        return None  # No solution

    x = (n * b - b * n) / determinant
    y = (a * n - a * b) / determinant

    return (x, y)
```

