def areEquivalent(num1, num2):
    """
    Checks whether the sum of divisors are same or not.

    Args:
        num1 (int): The first number.
        num2 (int): The second number.

    Returns:
        bool: True if the sum of divisors are the same, False otherwise.
    """
    def sum_of_divisors(num):
        sum_div = 0
        for i in range(1, int(num**0.5) + 1):
            if num % i == 0:
                sum_div += i
                if i != num // i:
                    sum_div += num // i
        return sum_div

    return sum_of_divisors(num1) == sum_of_divisors(num2)
