def answer(L,R):
    """
    Finds two distinct numbers such that their lcm lies within the given range.

    Args:
        L: The lower bound of the range.
        R: The upper bound of the range.

    Returns:
        A tuple containing the two distinct numbers whose lcm is within the range,
        or None if no such numbers exist.
    """
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return (a * b) // gcd(a, b)

    for i in range(1, R // 2 + 1):
        for j in range(i + 1, R):
            if lcm(i, j) >= L and lcm(i, j) <= R:
                return (i, j)

    return None
```

