def even_bit_set_number(n):
    """
    Sets all even bits of a given number.

    Args:
      n: An integer.

    Returns:
      An integer with all even bits set to 1.
    """
    count = 0
    while n > 0:
        if n & 1:
            count += 1
            n >>= 1
        else:
            n >>= 1

    if count == 0:
        return 0

    return n | (1 << count)
```

