def max_sum(arr, n):
    """
    Finds the maximum sum of bi-tonic sub-sequence for the given array.

    A bi-tonic subsequence is a subsequence such that the sum of the elements
    is greater than or equal to the sum of the elements in the subsequence.

    Args:
        arr (list): The input array.
        n (int): The length of the array.

    Returns:
        int: The maximum sum of a bi-tonic subsequence.
    """
    max_sum = 0
    for i in range(1 << n):
        subsequence = []
        for j in range(n):
            if (i >> j) & 1:
                subsequence.append(arr[j])
        if len(subsequence) > 0:
            current_sum = sum(subsequence)
            is_bi_tonic = True
            for k in range(len(subsequence)):
                for l in range(k + 1, len(subsequence)):
                    if subsequence[k] + subsequence[l] < current_sum:
                        is_bi_tonic = False
                        break
                if not is_bi_tonic:
                    break
            if is_bi_tonic:
                max_sum = max(max_sum, current_sum)
    return max_sum
