def count_Primes_nums(n):
    """
    Count the number of prime numbers less than a given non-negative number.
    For example:
    count_Primes_nums(10) == 4
    count_Primes_nums(20) == 8
    count_Primes_nums(2) == 1
    """
    if n <= 2:
        return 0

    is_prime = [True] * n
    is_prime[0] = is_prime[1] = False

    for i in range(2, int(n**0.5) + 1):
        if is_prime[i]:
            for j in range(i * i, n, i):
                is_prime[j] = False

    count = 0
    for i in range(2, n):
        if is_prime[i]:
            count += 1

    return count
```

