def newman_prime(n):
    """
    Finds the nth newman–shanks–williams prime number.

    The newman–shanks–williams prime number is a prime number that
    satisfies the following condition:
    p = 2 + 10^t mod phi(10^t)

    where p is the prime number, t is a positive integer, and
    phi(n) is Euler's totient function of n.

    Args:
        n: The index of the prime number to find (positive integer).

    Returns:
        The nth newman–shanks–williams prime number.
    """
    if n <= 0:
        raise ValueError("n must be a positive integer.")

    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def phi(n):
        result = n
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                while n % i == 0:
                    n //= i
                result -= result // i
        if n > 1:
            result -= result // n
        return result

    num = 2
    while True:
        if is_prime(num):
            prime = num
            break
        num += 1

    return prime
```

