    Finds the nth newman–shanks–williams prime number.

    The newman–shanks–williams prime number is defined as the prime number
    that is the nth term in the sequence of newman–shanks–williams primes.

    Args:
        n: The index of the prime number to find.

    Returns:
        The nth newman–shanks–williams prime number.
    """
    if n <= 0:
        raise ValueError("n must be a positive integer.")

    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def newman_shanks_williams_prime(p):
        """
        Finds the nth newman–shanks–williams prime number.
        """
        if is_prime(p):
            return p
        else:
            return newman_shanks_williams_prime(p - 1)

    count = 0
    p = 2
    while True:
        if is_prime(p):
            count += 1
            if count == n:
                return newman_shanks_williams_prime(p)
        p += 1
```

