def find_star_num(n):
    """
    Finds the n'th star number.

    The star number is defined as the sum of the first n integers starting from 1.
    For example, the first 5 star numbers are 1, 4, 10, 40, 100.

    Args:
        n: The index of the star number to find.

    Returns:
        The n'th star number.
    """
    if n == 0:
        return 1
    elif n == 1:
        return 1
    elif n == 2:
        return 2
    elif n == 3:
        return 6
    elif n == 4:
        return 20
    elif n == 5:
        return 66
    elif n == 6:
        return 126
    elif n == 7:
        return 558
    else:
        star_nums = [1, 1, 2, 6, 20, 66, 126, 558]
        if n <= len(star_nums):
            return star_nums[n - 1]
        else:
            return 0
