    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the count of such binary sequences.
    """
    dp = {}

    def solve(index, current_sum, first_n_bits, last_n_bits):
        if index == 2 * n:
            if current_sum == first_n_bits:
                return 1
            else:
                return 0

        if (index, current_sum, first_n_bits, last_n_bits) in dp:
            return dp[(index, current_sum, first_n_bits, last_n_bits)]

        count = 0
        for i in range(8):
            new_first_n_bits = first_n_bits + i
            new_last_n_bits = last_n_bits + i

            count += solve(index + 1, current_sum + i, new_first_n_bits, new_last_n_bits)

        dp[(index, current_sum, first_n_bits, last_n_bits)] = count
        return count

    return solve(0, 0, 0, 0)
