def max_sum_increasing_subseq(a, n, index, k) -> int:
    """
    Finds the maximum sum of increasing subsequence from prefix till ith index and also including a given kth element which is after i, i.e., k > i .
    For example:
    max_sum_increasing_subseq([1, 5, 2, 3, 4], 5, 2, 3) == 9
    max_sum_increasing_subseq([1, 5, 2, 3, 4], 5, 2, 1) == 9
    """
    dp = [0] * n
    for i in range(len(a) - 1, -1, -1):
        curr = a[i]
        if i == 0:
            dp[i] = curr
        else:
            for j in range(i + 1, n):
                if a[j] > curr:
                    dp[i] = max(dp[i], curr + a[j])
        if i == 0:
            dp[i] = curr
        else:
            dp[i] = max(dp[i], dp[i - 1] + a[i])
    return max(dp)
