def breakSum(n):
    """
    Finds the maximum sum we can make by dividing a number into three parts
    and summing them up together for the given number.

    Args:
        n: The number to divide.

    Returns:
        The maximum sum.
    """
    if n == 0:
        return 0
    if n == 1:
        return 0
    if n == 2:
        return 1
    if n == 3:
        return 2

    return breakSum(n // 3) + breakSum(n // 3 + 1) + breakSum(n // 3 + 2)
```

