def find_peak(arr, n):
    """
    Finds a peak element in the given array.

    A peak element is an element that is greater than or equal to its neighbors.
    If there are multiple peak elements, return the index of any one of them.

    Args:
        arr: The input array.
        n: The size of the array.

    Returns:
        The index of a peak element in the array.
    """
    for i in range(n):
        if i == 0:
            if arr[i] > arr[i+1]:
                return i
        elif i == n-1:
            if arr[i] > arr[i-1]:
                return i
        else:
            if arr[i] > arr[i-1] and arr[i] > arr[i+1]:
                return i
    return n - 1
```

