def largest_palindrome(A, n):
    """
    Finds the largest palindromic number in the given array.

    Args:
        A (list): A list of integers.
        n (int): The number of integers in the list.

    Returns:
        int: The largest palindromic number in the list.
    """
    largest = -1
    for num in A:
        if str(num) == str(num)[::-1]:
            if num > largest:
                largest = num
    if largest == -1:
        return -1
    else:
        return largest
```

